@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .
@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .

atm:ATM a owl:Class .
atm:Account a owl:Class .
atm:Bank a owl:Class .
atm:CashCard a owl:Class .
atm:Customer a owl:Class .

atm:ownsCard a owl:ObjectProperty ;
    rdfs:domain atm:Customer ;
    rdfs:range atm:CashCard .

atm:belongsToBank a owl:ObjectProperty ;
    rdfs:domain atm:ATM ;
    rdfs:range atm:Bank .

atm:hasAccount a owl:ObjectProperty ;
    rdfs:domain atm:Customer ;
    rdfs:range atm:Account .

atm:cardIssuedBy a owl:ObjectProperty ;
    rdfs:domain atm:CashCard ;
    rdfs:range atm:Bank .

atm:Response a owl:Class ;
    rdfs:subClassOf [
        a owl:Restriction ;
        owl:onProperty atm:belongsToBank ;
        owl:someValuesFrom atm:Bank
    ] .

atm:ErrorMessage a owl:Class ;
    rdfs:subClassOf [
        a owl:Restriction ;
        owl:onProperty atm:cardIssuedBy ;
        owl:someValuesFrom atm:Bank
    ] .

atm:NoResponse a owl:Class ;
    rdfs:subClassOf atm:Response ;
    owl:equivalentClass [
        a owl:Restriction ;
        owl:onProperty atm:belongsToBank ;
        owl:allValuesFrom atm:ErrorMessage
    ] .

atm:Request a owl:Class ;
    rdfs:subClassOf [
        a owl:Restriction ;
        owl:onProperty atm:belongsToBank ;
        owl:someValuesFrom atm:Bank
    ] .

atm:hasResponseTime a owl:DatatypeProperty ;
    rdfs:domain atm:Request ;
    rdfs:range xsd:integer .

atm:RejectedCard a owl:Class ;
    rdfs:subClassOf [
        a owl:Restriction ;
        owl:onProperty atm:hasResponseTime ;
        owl:allValuesFrom [
            a rdfs:Datatype ;
            owl:onDatatype xsd:integer ;
            owl:withRestrictions ( [ xsd:minExclusive 2 ] )
        ]
    ] .
